import React from "react";

function Header() {
  return (
    <div className="HeaderWrapper">
      <h1>EXPO</h1>
      <a href="/info">Information</a>
      <a href="/locations">Interview Locations</a>
      <a href="/volunteer">Volunteer</a>
      <a href="/committee">Committee</a>
    </div>
  );
}

export default Header;
